import React from 'react'

const Folder3 = ({name,age,city,course}) => {
  return (
    <div>
    <h1>hello: {name} </h1>
    <h1>age: {age}</h1>
    <h1>city: {city}</h1>
    <h1>Course: {course}</h1>
    </div>
  )
}

export default Folder3
